import React from "react";

const Selected_ItemList = props => {
  return (
    <div class='col s6 m6'>
      <div class='card blue-grey darken-1'>
        <div class='card-content white-text'>
          <span class='card-title'>{props.name}</span>
          <input
            className='col s3'
            type='number'
            id={props.name}
            value={props.item.req}
            onChange={props.change}
            autoFocus
          />
          <input
            className='col s3 offset-s1'
            type='number'
            value={props.item.totPrice}
            disabled
          />
        </div>
        <i
          class='material-icons'
          onClick={props.delt}
          id={props.name}
          style={{ fontSize: "3.3rem", cursor:"pointer" }}
        >
          delete_forever
        </i>
      </div>
    </div>
  );
};

export default Selected_ItemList;
